const Nav = ({h1}) => {
    return (
        <nav>
            <div id="hamburger_menu"><img src={"/icon/bars-solid.svg"} alt=""/></div>
            <div className="logo"></div>
            <h1>{h1}</h1>
        </nav>
    )
}

export default Nav;
